import React from 'react';
import styled from 'styled-components';

const BotaoCustomizado = styled.button`
    width: 65%;
    heigth: 20px;
    font-size: 15px;
    aling-content: center;
    text-aling: center;
    margin-top: 50px;
    margin-left: 70px;
`;



export default BotaoCustomizado;
